import React from "react";

import TaskBar from "./TaskBar";
import Task from "./Task";

export default function ViewTask({ listTasks, status }) {
  return (
    <div
      className="task__tab"
      style={{
        border: "1px solid red",
        marginTop: "3rem",
      }}
    >
      <TaskBar status={status} count={listTasks.length} />

      {listTasks.forEach((task) => {
        return;
        (<div className="tasks">
          <Task task={task} />
        </div>);
      })}
    </div>
  );
}
